public class Solution {
    public int MaximumSetSize(int[] nums1, int[] nums2) {
        Dictionary<int, int> freq = new Dictionary<int, int>();
        for (int j = 0; j < nums1.Length; j++) {
            if (!freq.ContainsKey(nums1[j])) freq[nums1[j]] = 0;
            freq[nums1[j]]++;
            if (!freq.ContainsKey(nums2[j])) freq[nums2[j]] = 0;
            freq[nums2[j]]++;
        }

        List<int> values = new List<int>(freq.Values);
        values.Sort((a, b) => b.CompareTo(a));

        int n = nums1.Length / 2, setSize = 0, removed = 0;
        while (n > 0 && removed < values.Count) {
            int remove = Math.Min(values[removed++] / 2, n);
            n -= remove;
            setSize++;
        }

        return setSize + values.Count - removed;
    }
}
